import { Component } from 'react';
import './Detail.css'
import Search from '../Search/Search';
import Gallery from '../Gallery/Gallery';
import PropTypes from "prop-types";
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

class Detail extends Component {
    constructor(props) {
        super(props);
    }  

    render() {
        if (document.getElementById("SearchID") != null) {
            document.getElementById("SearchID").style.display = 'none';
        }
        if (document.getElementById("SearchResultsID") != null) {
            document.getElementById("SearchResultsID").style.display = 'none';
        }
        if (document.getElementById("DetailID") != null) {
            document.getElementById("DetailID").style.display = 'block';
        }
        return (
            <Router>
                <div class="Detail" id = "DetailID">
                    {this.props.player.id}
                </div>
            </Router>
        );
    }
}

export default Detail;
